package allinone.business;

import org.slf4j.Logger;

import tools.CacheUserInfo;
import vn.game.common.LoggerContext;
import vn.game.protocol.AbstractBusiness;
import vn.game.protocol.IRequestMessage;
import vn.game.protocol.IResponsePackage;
import vn.game.protocol.MessageFactory;
import vn.game.session.ISession;
import allinone.data.AIOConstants;
import allinone.data.ResponseCode;
import allinone.data.UserEntity;
import allinone.protocol.messages.GetChiecNonRequest;
import allinone.protocol.messages.GetChiecNonResponse;

public class GetChiecNonBusiness extends AbstractBusiness {

	private static final Logger mLog = LoggerContext.getLoggerFactory()
			.getLogger(GetChiecNonBusiness.class);
        
        private static String chiecNon ="";
        
        private static int cacheVersion =2;
        
        
	public int handleMessage(ISession aSession, IRequestMessage aReqMsg,
			IResponsePackage aResPkg) {

		
		MessageFactory msgFactory = aSession.getMessageFactory();
		GetChiecNonResponse resBoc = (GetChiecNonResponse) msgFactory
				.getResponseMessage(aReqMsg.getID());
		try {
                    GetChiecNonRequest rqChiecNon = (GetChiecNonRequest) aReqMsg;
                    StringBuilder sb = new StringBuilder();
                    CacheUserInfo cacheUser = new CacheUserInfo();
                    UserEntity entity = cacheUser.getUserInfo(aSession.getUID(),aSession.getRealMoney());
                    sb.append(entity.timesQuay);
                    
                    
                    if(cacheVersion != rqChiecNon.cacheVersion)
                    {
                        sb.append(AIOConstants.SEPERATOR_BYTE_1);
                        sb.append(cacheVersion).append(AIOConstants.SEPERATOR_BYTE_1);
                        sb.append(chiecNon);
//                        sb.append(cacheVersion).append(AIOConstants.SEPERATOR_BYTE_3);
//                        sb.append(chiecNon1).append(AIOConstants.SEPERATOR_BYTE_1);
//                        sb.append(chiecNon2).append(AIOConstants.SEPERATOR_BYTE_1);
//                        sb.append(chiecNon3);
                    }
                    
                    resBoc.mCode = ResponseCode.SUCCESS;
                    resBoc.value = sb.toString();
                        
		} finally {
			aResPkg.addMessage(resBoc);
		}
		return 1;
	}

	
}
